"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   blogPosts: () => (/* binding */ blogPosts),\n/* harmony export */   getAllBlogs: () => (/* binding */ getAllBlogs),\n/* harmony export */   getBlogBySlug: () => (/* binding */ getBlogBySlug),\n/* harmony export */   getBlogsByCategory: () => (/* binding */ getBlogsByCategory),\n/* harmony export */   getBlogsByTag: () => (/* binding */ getBlogsByTag)\n/* harmony export */ });\nconst blogPosts = [\n    {\n        id: 1,\n        title: \"If Everyone Can Prompt, Do We Still Need Designers?\",\n        slug: \"if-everyone-can-prompt-do-we-still-need-designers\",\n        excerpt: \"In this prompt-driven world, anyone can generate. But only designers can interpret, refine, and lead.\",\n        content: `\n      <p>Heres what no ones saying out loud: Prompting is not design.</p>\n      \n      <p>Anyone can open Stitch and generate a screen in seconds. Figma Make will turn a napkin sketch into a full UI. Cursor can write production-ready code from a design prompt.</p>\n      <p>So, does that mean the role of the designer is dead?</p>\n      <p>No  it means its evolving. Fast.</p>\n      <p>These tools democratise execution. But they don't replace critical thinking. They dont know your user. They dont challenge assumptions. They don't test, iterate, or align with business goals. In this prompt-driven world, anyone can generate.</p>\n      <p>But only designers can interpret, refine, and lead.</p>\n\n      \n      <h2>Want to stay valuable? Do this:</h2>\n      <h3>Learn the tools  Stitch, Figam Make, V0, Cursor  but dont stop there.</h3>\n      <p>Getting started is easy, but mastering them isnt. Tools like Stitch are built with engineering logic underneath; knowing how developers think gives you a major edge when refining generated outputs.</p>\n      \n      <h3>Become a curator, not just a creator.</h3>\n      <p>AI can generate 10 screens in 10 seconds  your job is to choose which one works, refine why it works, and craft a cohesive experience from it. Think of Stitch as your intern: it can throw out raw ideas, but you shape the final outcome that fits the brand, the goal, and the user.</p>\n\n      <h3>Focus on the why behind every interface.</h3>\n      <p>AI can output a navigation bar  but it wont understand why users expect one thing in fintech and another in social media. UX isnt just about structure, its about emotion, trust, and behaviour  things AI hasnt mastered (yet). Your advantage? You know why users bounce, tap, ignore, or convert. Keep asking why at every step  then design with that clarity in mind.</p>\n\n      <h3>Connect user behaviour with business outcomes.</h3>\n      <p>Great design isnt just beautiful or usable  it drives revenue, retention, and growth. The best designers dont just build for the user; they translate insights into business wins.</p>\n\n      <p>The future of design isnt about being faster.</p>\n      <p>Its about being smarter with the speed.</p>\n\n      <p>We dont need fewer designers.</p>\n      <p>We need ones who can think  and lead  in the age of AI.</p>\n    `,\n        author: \"Nqobile Vundla\",\n        publishedAt: \"31 May 2025\",\n        readTime: \"2 min read\",\n        category: \"AI & Design\",\n        tags: [\n            \"Design Tools\",\n            \"AI and Design\",\n            \"Future of UX\",\n            \"Human-Centered Design\",\n            \"Design Leadership\"\n        ],\n        coverImage: \"/blog/prompt-driven-design.jpg\"\n    },\n    {\n        id: 2,\n        title: \"Why You Should Always Be Ready to Get Laid Off\",\n        slug: \"why-you-should-always-be-ready-to-get-laid-off\",\n        excerpt: \"Youre not immune. No one is. Thats why the smartest designers arent just designing  theyre future-proofing.\",\n        content: `\n      <p>Heres the brutal truth:</p>\n      <p>Tech isnt stable. Design jobs? Even less so.</p>\n      <p>In 2023 alone, over 262,000 tech workers were laid off. The trend hasnt slowed down  2024 saw more than 150,000 layoffs across hundreds of companies. Even in 2025, roles are being cut daily. Designers, PMs, and engineers who thought they were safe were suddenly jobless.</p>\n      <p>Youre not immune. No one is.</p>\n\n      <p>Thats why the smartest designers arent just designing  theyre future-proofing.</p>\n      <p>Because waiting for a layoff to start preparing is how you get left behind.</p>\n\n\n      <h2>Want to stay ready? Heres how:</h2>\n      <h3>Keep your portfolio sharp  always</h3>\n      <p>Dont wait until your contract ends or your calendar clears. Update your portfolio every time you finish a project  while the strategy, design thinking, and outcomes are still fresh in your head. This way, when an opportunity (or crisis) comes, youre not scrambling through old files  youre ready to send.</p>\n      \n      <h3>Network before you need to</h3>\n      <p>Networking isnt just for when youre job hunting  its career insurance. Set a standing reminder to connect, attend a local UX meetup, join a webinar, or just check in with someone in your field once a month.</p>\n      \n      <h3>Join design communities (Slack, Discord, LinkedIn)</h3>\n      <p>Most of todays hiring signals start in DMs and group chats  not job boards. The best design communities dont just offer support  they post leads, freelance gigs, and internal referrals before roles go public.</p>\n      \n      <h3>Share your work, your process, your thinking  build visibility</h3>\n      <p>Dont just design in silence. Post your work on LinkedIn, write case studies on Behance, tweet your UX insights  show the thinking behind your designs.</p>\n      \n      <h3>Dont tie your identity to one company, one tool, or one title</h3>\n      <p>Heres a hard truth: you are not your job title. That tool youve mastered might be irrelevant in 6 months. That company you love might cut your role to save margin.</p>\n      \n      <p>Companies are solving for their bottom line  not your long-term career. Stay flexible, stay learning, and never let one logo define your value.</p>\n      <p>Being laid off isnt the end  its part of the industry now. But being caught off guard? Thats optional.</p>\n      <p>The designers who thrive arent lucky. Theyre ready, visible, and always in motion.</p>\n      \n    `,\n        author: \"Nqobile Vundla\",\n        publishedAt: \"30 May 2025\",\n        readTime: \"2 min read\",\n        category: \"Job Security\",\n        tags: [\n            \"Career Resilience\",\n            \"Design Industry Trends\",\n            \"Portfolio Tips\",\n            \"Networking for Designers\"\n        ],\n        coverImage: \"/blog/getting-laid-off.jpg\"\n    },\n    {\n        id: 3,\n        title: \"The Designers of Today Might Not Be the Designers of the Future\",\n        slug: \"the-designers-of-today-might-not-be-the-designers-of-the-future\",\n        excerpt: \"Design is evolving  fast. The tools, workflows, and even the definition of UX are shifting.\",\n        content: `\n      <p>Heres the truth no one wants to say out loud:</p>\n      <p>Your current skillset might expire faster than you think.</p>\n      <p>Design is evolving  fast. The tools, workflows, and even the definition of UX are shifting.</p>\n      <p>If youre stuck in the processes of yesterday, you wont be around for the outcomes of tomorrow.</p>\n      <p>Who are the designers who will lead the future?</p>\n      <p>They think differently  and they move differently.</p>\n      \n      <h2>Want to stay future-proof? Heres how:</h2>\n      <h3>Ditch fixed processes  focus on flexibility</h3>\n      <p> Rigid design methods are fading. What worked in Figma last year might be solved faster by AI-generated layouts in V0. Be ready to unlearn, remix, and redesign your own process based on the outcome  not the playbook.</p>\n      \n      <h3>Prioritise continuous learning</h3>\n      <p>The most dangerous mindset in tech is I already know how to do that. If you're not exploring tools like Cursor (for AI-paired code), Framer (for interactive, no-code sites), or V0, youre already behind. Set a personal goal: one new tool or skill explored every month.</p>\n      \n      <h3>Design for outcomes, not outputs</h3>\n      <p>Dont get attached to pixels. Get obsessed with results. The interfaces of the future will be designed around what they achieve  not how pretty they look. Start thinking: what does success look like for this user and this business?</p>\n      \n      <h3>Stay tool-agnostic</h3>\n      <p>Today its Figma. Tomorrow it might be Framer, V0, or something entirely new. Master the thinking  research, insight, systems  and youll adapt to any tool the future throws at you.</p>\n      \n      <h3>Move with the industry, not against it</h3>\n      <p>Designers who resist change lose relevance. The ones who lean in become the new standard. Follow whats happening in AI, product thinking, and no-code/low-code platforms. Not to chase trends  but to stay useful.</p>\n      \n      <p>The future isnt waiting for anyone. The question is: are you designing it, or getting designed out of it?</p>\n    `,\n        author: \"Nqobile Vundla\",\n        publishedAt: \"15 May 2025\",\n        readTime: \"2 min read\",\n        category: \"Future of Design\",\n        tags: [\n            \"Future of Design\",\n            \"AI in Design\",\n            \"Continuous Learning\",\n            \"Outcome-Based Design\"\n        ],\n        coverImage: \"/blog/future-designer.jpg\"\n    },\n    {\n        id: 4,\n        title: \"AI Is a Leveler  We All Have 0 Years of AI Experience\",\n        slug: \"ai-is-a-leveler-we-all-have-0-years-of-ai-experience\",\n        excerpt: \"It doesnt matter how long youve been in UX, product, or visual design  tools like ChatGPT, Framer, and V0 aren't concerned about your resume. They care about your ability to adapt fast.\",\n        content: `  \n      <p>Lets get honest: Your 10 years of experience? Irrelevant in this new game.</p>\n      <p>Because when it comes to AI, were all starting from scratch.</p>\n      <p>It doesnt matter how long youve been in UX, product, or visual design  tools like ChatGPT, Framer, and V0 aren't concerned about your resume. They care about your ability to adapt fast.</p>\n      <p>This isnt a bad thing. Its a massive opportunity.</p>\n\n      <h2>Heres how to win when everyones starting at zero:</h2>\n      <h3>Adopt a beginners mindset  on purpose</h3> \n      <p>Forget what you already know and get curious again. The best designers now are the ones who arent afraid to ask dumb questions, test fast, and play with AI tools like Cursor or V0 without waiting for permission.</p>\n      \n      <h3>Learn code-based design  even just enough</h3>\n      <p>You dont have to become an engineer. But tools like Cursor are making hybrid roles the new normal. Understanding how your UI ideas translates to code gives you leverage  especially when prototyping or collaborating in AI-paired workflows.</p>\n      \n      <h3>Speed is a skill  build it intentionally</h3>\n      <p>AI isn't just about automation. It's about acceleration. Practice building MVPs, iterating concepts, and shipping prototypes fast. The quicker you go from idea to interface, the more valuable you become.</p>\n      \n      <h2>Master prompts, not just pixels</h2>\n      <p>Prompting AI isnt a side skill  its the skill. Knowing how to get AI to generate usable layouts, code snippets, or content direction is becoming just as important as traditional design tools.</p>\n      \n      <h2>Out learn everyone</h2>\n      <p>Well, at least try to. The advantage now isnt who knows the most  its who learns the fastest. Make it your mission to learn one new AI tool or framework each month. Be the designer whos never outdated. You dont have to be a master at all of them</p>\n      \n      <p>Heres the good news:</p>\n      <p>AI levelled the field. The playing boards clear. The clocks reset.</p>\n      <p>Now its not about who was the best  Its about who can evolve the fastest.</p>\n    `,\n        author: \"Nqobile Vundla\",\n        publishedAt: \"15 May 2025\",\n        readTime: \"3 min read\",\n        category: \"AI & Design\",\n        tags: [\n            \"AI in Design\",\n            \"Beginners Mindset\",\n            \"Design Adaptability\",\n            \"Prompt Engineering\"\n        ],\n        coverImage: \"/blog/ai-leveler.jpg\"\n    },\n    {\n        id: 5,\n        title: \"Why You Should Focus on Outcomes, Not Processes  Redefining the Design Process in the Age of AI\",\n        slug: \"why-you-should-focus-on-outcomes-not-processes-redefining-the-design-process-in-the-age-of-ai\",\n        excerpt: \"Heres the shift most designers havent made yet: The process you mastered no longer guarantees success. Thats a hard pill to swallow, especially if you had a good thing going on.\",\n        content: `\n      <p>All I know is, AI broke the sequence.</p>\n      <p>Design is no longer linear. Its not research  wireframes  UI  handoff.</p>\n      <p>Its chaotic, fast, and fluid. And if youre still obsessing over your process, youre missing the point.</p>\n      \n      <h2>In the AI era, the only thing that matters is: Did it work?</h2>\n      <h3>Start with outcomes, not deliverables</h3>\n      <p>No one cares about your beautiful mockups if they dont drive behaviour. Ask yourself: What change do we want to create? Then reverse-engineer everything from that outcome.</p>\n      \n      <h3>Let AI do the heavy lifting  but keep control</h3>\n      <p>Tools like ChatGPT can help generate content structure or UX copy. Midjourney can help visualise fast. But youre still the one responsible for making it make sense. Use AI to speed up execution, not to outsource thinking.</p>\n      \n      <h3>Stop worshipping the design process</h3>\n      <p>Linear methods wont survive. What works today is rapid iteration, flexible inputs, and real-time testing. Design is no longer a perfectly crafted flow  its a live system that evolves with every user interaction.</p>\n      \n      <h3>Prototype for proof, not perfection</h3>\n      <p>Working prototypes win over polished decks. Build something you can test  even if it's rough. Because iteration is faster than explanation.</p>\n      \n      <h3>Think like a strategist, not just a stylist</h3>\n      <p>AI tools are closing the gap between ideas and execution. What separates you is thinking. Outcomes are business goals, user goals, product realities  not just clean UIs. Make every design decision accountable to that.</p>\n      \n      <p>The old way? Craft. Handoff. Wait.</p>\n      <p>The new way? Test. Learn. Adapt. Ship.</p>\n      <p>Your value isnt in following the process. Its in delivering results  however they come to life.</p>\n    `,\n        author: \"Nqobile Vundla\",\n        publishedAt: \"5 May 2025\",\n        readTime: \"3 min read\",\n        category: \"AI & Design\",\n        tags: [\n            \"Outcome-Based Design\",\n            \"AI-Driven Workflows\",\n            \"Design Strategy\",\n            \"Redefining UX Process\"\n        ],\n        coverImage: \"/blog/process.jpg\"\n    }\n];\nconst getBlogBySlug = (slug)=>{\n    return blogPosts.find((post)=>post.slug === slug);\n};\nconst getAllBlogs = ()=>{\n    return blogPosts.sort((a, b)=>new Date(b.publishedAt).getTime() - new Date(a.publishedAt).getTime());\n};\nconst getBlogsByCategory = (category)=>{\n    return blogPosts.filter((post)=>post.category === category);\n};\nconst getBlogsByTag = (tag)=>{\n    return blogPosts.filter((post)=>post.tags.includes(tag));\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./lib/blogs.ts\n");

